import React from "react";
import Card from "./Card";
import Ndata from "./Ndata";


const Netf = () =>{

    return(
        <Card 
        key={Ndata[0].id}
        imgscr ={Ndata[0].imgscr} 
        title = {Ndata[0].title} 
        sname = {Ndata[0].sname} 
        link = {Ndata[0].link}                 
        />
     );
}

export default Netf;
